properties.value:
{
            label: checkboxLabel,
            onchange: {
                fn: "itemClick",
                args: {
                    item : item,
                    itemIdx : item.index
                }
            },
            id: 'listItem' + item.index,
            bind:{
                "value": {
                    inside: item, to: 'selected'
                },
                "disabled" : {
                    inside : item, to: "currentlyDisabled"
                    }
            },
            value: item.selected
        }

